import React, { useEffect, useState } from 'react';

function App() {
  const [users, setUsers] = useState(null);

  useEffect(() => {
    fetch('http://localhost:3000/', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
        'Accept': 'application/json',
      },
      body: JSON.stringify({
        query: `
          query {
            data {
              id
              nb_block
              starknet_block
              eventCount
            }
          }
        `
      })
    })
    .then(r => r.json())
    .then(data => {
      console.log('API response:', data); // Etape 4: Vérifiez la réponse de l'API
      setUsers(data.data.users);
    })
    .catch(error => console.error('Error fetching data:', error)); // Etape 3: Gérez les erreurs
  }, []);

  if (!users) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      {users.map(user => (
        <div key={user.id}>
          <p>{user.name}</p>
        </div>
      ))}
    </div>
  );
}

export default App;
